import './AmazingNumberButton.css';

function tbody(){

}
const ButtonNumber = (props) => { 
const touch = [1,2,3,4,5,6,7,8,9,0];
  return(
    <>
    {touch.forEach(element => 
    <div class="calc-button-row">
    <button onClick={() => {props.numb(element)}} className="button">{element}</button>
    <button onClick={() => {props.numb(2)}} class="button">2</button>
    <button onClick={() => {props.numb(3)}} class="button">3</button>
  </div>
  )}
  <div class="calc-button-row">
    <button onClick={() => {props.numb(4)}} class="button">4</button>
    <button onClick={() => {props.numb(5)}} class="button">5</button>
    <button onClick={() => {props.numb(6)}} class="button">6</button>

  </div>
  <div class="calc-button-row">
    <button onClick={() => {props.numb(7)}} class="button">7</button>
    <button onClick={() => {props.numb(8)}} class="button">8</button>
    <button onClick={() => {props.numb(9)}} class="button">9</button>
    <button onClick={() => {props.numb(0)}} class="button">0</button>
  </div>
  </>
  ) 

}


export default ButtonNumber;
